CREATE DEFINER=`root`@`%` PROCEDURE `BuyCart` (IN `input_user_id` INT)   BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE get_listing_id INT;

    DECLARE cart_cursor CURSOR FOR 
        SELECT Cart.listing_id FROM Cart WHERE Cart.user_id = input_user_id;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    IF NOT EXISTS(SELECT 1 FROM Users WHERE Users.id = input_user_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Пользователь не существует!';
    END IF;
    
    IF NOT EXISTS(SELECT 1 FROM Cart WHERE Cart.user_id = input_user_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Ваша корзина пуста!';
    END IF;

    SET TRANSACTION ISOLATION LEVEL READ COMMITTED;
    START TRANSACTION;

    OPEN cart_cursor;

    main_loop: LOOP
        FETCH cart_cursor INTO get_listing_id;

        IF done THEN
            LEAVE main_loop;
        END IF;

        CALL BuyListing(input_user_id, get_listing_id);
    END LOOP;

    CLOSE cart_cursor;

    COMMIT;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `BuyListing` (IN `user_id` INT, IN `listing_id` INT)   BEGIN
    DECLARE user_balance DECIMAL(10, 2);
    DECLARE seller_balance DECIMAL(10, 2);
    DECLARE listing_price DECIMAL(10, 2);
    DECLARE seller_id INT;

    START TRANSACTION;

    -- Проверяем существование пользователя
    IF NOT EXISTS (SELECT 1 FROM Users WHERE id = user_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Такого пользователя не существует!';
    END IF;

    -- Проверяем существование листинга
    IF NOT EXISTS (SELECT 1 FROM Listings WHERE id = listing_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'На площадке нет такого предмета!';
    END IF;
    
    -- Проверяем, что листинг еще не куплен
    IF EXISTS (SELECT 1 FROM Purchases WHERE Purchases.listing_id = listing_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Предмет уже куплен!';
    END IF;
    
    -- Проверяем, что листинг покупается не его владельцем
    IF EXISTS (SELECT 1 FROM Listings WHERE Listings.seller_id = user_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Вы не можете купить свои же предметы!';
    END IF;

    -- Получаем баланс пользователя
    SELECT Users.balance INTO user_balance FROM Users WHERE Users.id = user_id;
    SELECT Users.balance, Listings.seller_id INTO seller_balance, seller_id FROM Listings JOIN Users ON Listings.seller_id = Users.id WHERE Listings.id = listing_id;
    
    -- Получаем цену листинга
    SELECT Listings.price INTO listing_price FROM Listings WHERE Listings.id = listing_id;
    
    -- Проверяем, достаточно ли у пользователя средств
    IF user_balance < listing_price THEN
        -- Если не достаточно средств, генерируем ошибку с пользовательским сообщением
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Недостаточно средств на балансе!';
    END IF;

    -- Вставляем запись о покупке
    
    -- Обновляем баланс пользователя
    UPDATE Users SET Users.balance = user_balance - listing_price WHERE Users.id = user_id;
    UPDATE Users SET Users.balance = seller_balance + listing_price WHERE Users.id = seller_id;

    -- Фиксация транзакции
    COMMIT;
    
    -- Текст успешного выполнения
    SELECT 'Purchase successful.' AS Result;
    
END$$

