CREATE DEFINER=`root`@`%` PROCEDURE `deb2` (IN `filter_ids` VARCHAR(255))   BEGIN
    -- Разбиваем строку с filter_id на отдельные элементы
    SET @sql = CONCAT('SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(t.ids, \',\', n.n), \',\', -1) id
                       FROM (SELECT 1 n UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4) n
                       CROSS JOIN (SELECT ? ids) t
                       WHERE n.n <= 1 + (LENGTH(t.ids) - LENGTH(REPLACE(t.ids, \',\', \'\')))');
    PREPARE stmt FROM @sql;
    EXECUTE stmt USING @filter_ids;
    DEALLOCATE PREPARE stmt;

    -- Получаем результаты
    SELECT l.id
    FROM Listings l
    JOIN ListingFilters lf ON lf.listing_id = l.id
    JOIN Filters f ON f.id = lf.filter_id
    WHERE f.id IN (SELECT id FROM temp_table)
    GROUP BY l.id
    HAVING COUNT(DISTINCT f.filter_category_id) = (SELECT COUNT(DISTINCT filter_category_id) FROM Filters WHERE id IN (SELECT id FROM temp_table))
           AND COUNT(f.id) = (SELECT COUNT(id) FROM temp_table);
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `DEBUG_PROC` (IN `filter_ids` VARCHAR(255))   BEGIN
    -- Создаем временную таблицу для хранения всех listing_id
    CREATE TEMPORARY TABLE temp_listings (listing_id INT, filter_category_id INT, filter_id INT);

    -- Парсим переданные filter_ids
    SET @filters = filter_ids;

    -- Заполняем временную таблицу
    SET @sql = CONCAT('INSERT INTO temp_listings (listing_id, filter_category_id, filter_id)
                      SELECT lf.listing_id, f.filter_category_id, lf.filter_id
                      FROM ListingFilters lf
                      JOIN Filters f ON lf.filter_id = f.id
                      WHERE lf.filter_id IN (', @filters, ')');
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
