            GROUP BY listing_id, filter_category_id
            HAVING COUNT(*) = (SELECT COUNT(DISTINCT id) FROM Filters WHERE id IN (@filters) AND filter_category_id = temp_listings.filter_category_id)
        ) subquery
        GROUP BY listing_id
        HAVING COUNT(*) = (SELECT COUNT(DISTINCT filter_category_id) FROM Filters WHERE id IN (@filters))
    );

    -- Удаляем временную таблицу
    DROP TEMPORARY TABLE IF EXISTS temp_listings;
END$$

