CREATE DEFINER=`root`@`%` PROCEDURE `GetFilterCategoryID` (IN `id_string` VARCHAR(255))   BEGIN
    -- Создаем временную таблицу для хранения ID
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_ids (id INT);

    -- Заполняем временную таблицу значениями из строки
    SET @sql = CONCAT('INSERT INTO temp_ids (id) VALUES (', REPLACE(id_string, ', ', '),('), ')');
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;

    -- Выбираем уникальные filter_category_id из таблицы Filters
    SELECT DISTINCT filter_category_id
    FROM Filters
    WHERE id IN (SELECT id FROM temp_ids);

    -- Удаляем временную таблицу
    DROP TEMPORARY TABLE IF EXISTS temp_ids;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `GetListingFilters` (IN `game_name` VARCHAR(255))   BEGIN
    IF game_name = '' THEN
                SELECT l.id,
            Games.game as "game",
            Items.name as "item",
            Users.name as "seller",
            l.price as "price",
            Images.url as "url",
            f.id as "filter_id",
            fc.id as "category_id"
            FROM Listings l
            JOIN Items ON l.item_id = Items.id
            JOIN Users ON Users.id = l.seller_id
            JOIN Images ON Images.id = Items.image_id
            JOIN Games ON Items.game_id = Games.id
            JOIN ListingFilters lf on lf.listing_id = l.id
            JOIN Filters f ON f.id = lf.filter_id
            JOIN Filter_categories fc ON fc.id = f.filter_category_id
            WHERE NOT EXISTS(SELECT 1 FROM Purchases WHERE Purchases.listing_id = l.id);
    END IF;
    IF game_name <> '' THEN
                SELECT l.id,
            Games.game as "game",
            Items.name as "item",
            Users.name as "seller",
            l.price as "price",
            Images.url as "url",
            f.id as "filter_id",
            fc.id as "category_id"
            FROM Listings l
            JOIN Items ON l.item_id = Items.id
            JOIN Users ON Users.id = l.seller_id
            JOIN Images ON Images.id = Items.image_id
            JOIN Games ON Items.game_id = Games.id
            JOIN ListingFilters lf on lf.listing_id = l.id
            JOIN Filters f ON f.id = lf.filter_id
            JOIN Filter_categories fc ON fc.id = f.filter_category_id
