CREATE DEFINER=`root`@`%` PROCEDURE `GetUserPurchases` (IN `user_id` INT)   BEGIN

SELECT
	Purchases.id,
    Items.name as "item",
    Users.name as "customer",
    Listings.price as "price",
    Purchases.purchase_date as "date",
    Images.url as "url"
FROM Purchases
JOIN Listings ON Listings.id = Purchases.listing_id
JOIN Items ON Listings.item_id = Items.id
JOIN Images ON Items.image_id = Images.id
JOIN Users ON Purchases.customer_id = Users.id
WHERE Purchases.customer_id = user_id
ORDER BY Purchases.purchase_date DESC;

END$$

CREATE DEFINER=`root`@`%` PROCEDURE `GetUserTransactions` (IN `user_id` INT)   BEGIN

SELECT
	Transactions.id AS "id",
    Users.name AS 'user',
    Transactions.transaction_type as "type",
    Transactions.value as "value",
    Transactions.transaction_date as "date"
FROM Transactions
JOIN Users ON Users.id = Transactions.user_id
WHERE Transactions.user_id = user_id
ORDER BY Transactions.transaction_date DESC;

END$$

CREATE DEFINER=`root`@`%` PROCEDURE `WithdrawBalance` (IN `user_id` INT, IN `val` DECIMAL(10,2))   BEGIN
	DECLARE user_balance DECIMAL(10,2);
    
    SET TRANSACTION ISOLATION LEVEL READ COMMITTED;
    START TRANSACTION;
    -- Проверяем, что пользователь существует
    IF NOT EXISTS(SELECT 1 FROM Users WHERE Users.id = user_id) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Такого пользователя не существует!';
    END IF;
    
    SELECT Users.balance INTO user_balance FROM Users WHERE Users.id = user_id;
    
    IF val < 10 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Минимальная сумма вывода - 10 BYN!';
    END IF;
    
    IF user_balance < val THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'У вас недостаточно средств на балансе!';
    END IF;
    
    UPDATE Users SET Users.balance = user_balance - val WHERE Users.id = user_id;
    

SELECT "Funds successfuly withdrawed!";

COMMIT;
    
END$$

